import React from "react";

const RoleTable = ({ roles, onEdit, onDelete }) => {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
          <th>Permissions</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {roles.map((role) => (
          <tr key={role._id}>
            <td>{role.name}</td>
            <td>{role.permissions.join(", ")}</td>
            <td>
              <button onClick={() => onEdit(role)}>Edit</button>
              <button onClick={() => onDelete(role._id)}>Delete</button>
            </td>
          </tr>
        ))}
      </tbody>
    </table>
  );
};

export default RoleTable;
